import React from 'react';
import { Slide } from 'react-slideshow-image';
import './SlideShow.css'

const slideImages = [
    "data:",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTPqsKCsbPE7kTPe-n93g6kWIohszZA4fqbEfkRQo70UmBBdKt0A",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ6zD394Btz5QPnfF3zfnHX8oWR7iJIY2oi-0-rGz_okMWoi9PXMA",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRoZGWaIY8Num_pc6FVDoLrPnyct3YP9Yl-DhfUUsbNFIZZYf_32Q"  
];

const properties = {
  duration: 5000,
  transitionDuration: 500,
  infinite: true,
  indicators: true,
  arrows: true
}

const SlideShow = () => {
    return (
      <Slide {...properties}>
        <div className="each-slide">
          <div style={{'backgroundImage': `url(${slideImages[0]})`}}>
        </div>
        </div>
        <div className="each-slide">
          <div style={{'backgroundImage': `url(${slideImages[1]})`}}>
        </div>
        </div>
        <div className="each-slide">
          <div style={{'backgroundImage': `url(${slideImages[2]})`}}>
        </div>
        </div>
        <div className="each-slide">
          <div style={{'backgroundImage': `url(${slideImages[3]})`}}>
        </div>
        </div>
      </Slide>
    )
}

export default SlideShow;
